&НаКлиенте
Процедура ВыполнитьРасчет(Команда)
ВыборДанных = Новый Запрос;
ВыборДанных.Текст = "ВЫБРАТЬ Товар, Сумма(Стоимость) КАК СуммаПоТовару, Количество(*) как КоличествоЗакупок
| ИЗ Документ.ПоступлениеТоваров.ПереченьТоваров
| ГДЕ Товар = &ЗаданныйТовар
| СГРУППИРОВАТЬ ПО Товар
| УПОРЯДОЧИТЬ ПО СуммаПоТовару УБЫВ";
ВыборДанных.УстановитьПараметр("ЗаданныйТовар", ВводТовар);
Результат = ВыборДанных.Выполнить().Выбрать();
Пока результат.Следующий() Цикл
ДанныеПоТовару = Строка(Результат.Товар)+"   "+Строка(Результат.СуммаПоТовару)+ "      " + Строка(Результат.КоличествоЗакупок);
Сообщить(ДанныеПоТовару);
КонецЦикла
КонецПроцедуры

