&НаКлиенте
Процедура ПолучитьДанные(Команда)
ВыборДанных = Новый Запрос;
ВыборДанных.Текст = "ВЫБРАТЬ Ссылка.Номер КАК Номер, Ссылка.Дата КАК Дата, Ссылка.Поставщик КАК Поставщик,  Стоимость
| ИЗ Документ.ПоступлениеТоваров.ПереченьТоваров
| ГДЕ (Стоимость >= &ЗаданнаяСтоимость) И (Ссылка.Дата >= &ЗаданнаяДата)
| УПОРЯДОЧИТЬ ПО Номер";
ВыборДанных.УстановитьПараметр("ЗаданнаяСтоимость", МинимальнаяСумСтоимость);
ВыборДанных.УстановитьПараметр("ЗаданнаяДата", НачальнаяДата);
Результат = ВыборДанных.Выполнить().Выбрать();
Пока результат.Следующий() Цикл
ЗакупкаТовара = Строка(Результат.Номер)+"  "+Строка(Результат.Дата)+"  "+Строка(Результат.Поставщик)+"  "+Строка(Результат.Стоимость);
Сообщить(ЗакупкаТовара);
КонецЦикла
КонецПроцедуры

